import { Component } from "react"
import styles from './ExperienceContainer.module.css';

export default class ExperienceContainer extends Component {
    constructor() {
        super()
    }

    render() {
        return(
            <div className={styles.mainContainer}>
                <div><h3>Before starting my education I had only worked common odd jobs. I was a health care worker 
                            and for several years, on and off (while going to school), I worked in a warehouse.</h3></div>
                <div></div>
                <div></div>
                <div></div>
                <div></div>
            </div>
        )
    }
}
